import React from 'react';
import styles from './Navbar.module.css'

const Navbar = ({types, current}) => {

    return (
        <div>
            {types.map((item) => {
                return (
                    <div key={item.id} className={(current ? styles.acitve + styles.item : styles.item)}>
                        <p>{item.name}</p>
                    </div>
                )
            })}
        </div>
    );
};

export default Navbar;
